import React, { Component } from "react";

class Gif extends Component {
    render() {
        let { handleGifSearch } = this.props;
        return (
            <div className="">
                <input
                    type="text"
                    className="form-control"
                    placeholder="Search..."
                    onChange={handleGifSearch}
                    // value={value}
                ></input>
                <div className="d-flex"></div>
            </div>
        );
    }
}

export default Gif;
